Friends is een Amerikaanse situatiekomedie, oorspronkelijk uitgezonden door NBC (werd in Nederland uitgezonden op NET 5 en RTL 5, nu op Veronica, in Vlaanderen op VT4) en geproduceerd door Warner Bros. Television en Bright/Kauffman/Crane Productions. In de Verenigde Staten kwam de eerste aflevering (The One Where Monica Gets A Roommate, beter bekend als The One Where It All Began) op 22 september 1994 op de televisie. De laatste aflevering (The Last One) werd in de Verenigde Staten op 6 mei 2004 uitgezonden.

De serie draait om een groep van zes vrienden; Rachel Green, Ross Geller, Monica Geller, Chandler Bing, Joey Tribbiani en Phoebe Buffay. De zes twintigers wonen en werken in Manhattan, New York. Als het verhaal begint, heeft Rachel net haar verloofde Barry voor het altaar achter gelaten en is ze samen gaan wonen met haar beste vriend uit haar kindertijd, Monica. Het tweetal woont in een appartement tegenover dat van Chandler en Joey en ze trekken veel op met Monica's broer, Ross - die recent gescheiden is van zijn lesbische echtgenote. Daarnaast is er Phoebe, Monica's oude kamergenote. Het verhaal speelt zich voornamelijk af in Monica's appartement, Chandler en Joeys appartement, Ross' appartement, Phoebes appartement en het lokale koffiehuis, Central Perk.


